import React, { useState } from 'react';
import '../assets/css/adminlte.css';
import Img from "../assets/plantilla/logo_final_2.png";
import Img2 from "../assets/plantilla/parqueadero.jpeg";
import { Image } from "react-bootstrap";

const LoginForm = () => {
    const [ingUsuario, setIngUsuario] = useState('');
    const [ingPassword, setIngPassword] = useState('');

    const handleSubmit = (event) => {
        event.preventDefault();
        // Handle form submission logic here (e.g., API call, validation)
        console.log('Username:', ingUsuario);
        console.log('Password:', ingPassword);
    };

    return (
        <div id="back">
       <div className="banner">
       {/* <Image src={Img2} className="banner"   /> */}
            <div className="login-box">
            
                <div className="login-box-body" style={{ borderRadius: '21px' }}>
                    <div className="login-logo">
                        <Image src={Img}  className="img-responsive" style={{ padding: '1px 30px 0px 30px' }}  />
                    </div>
                    <p className="login-box-msg">Ingresar al sistema</p>
                    <form onSubmit={handleSubmit}>
                        <div className="form-group has-feedback">
                            <input type="text" className="form-control" placeholder="Usuario" name="ingUsuario" value={ingUsuario} onChange={(e) => setIngUsuario(e.target.value)} required />
                            <span className="glyphicon glyphicon-user form-control-feedback"></span>
                        </div>
                        <div className="form-group has-feedback">
                            <input type="password" className="form-control" placeholder="ContraseÃ±a" name="ingPassword" value={ingPassword} onChange={(e) => setIngPassword(e.target.value)} required />
                            <span className="glyphicon glyphicon-lock form-control-feedback"></span>
                        </div>
                        <div className="row">
                            <div className="col-xs-4">
                                <button type="submit" className="btn btn-primary btn-block btn-flat">Ingresar</button>
                            </div>
                        </div>
                    </form>
                </div>
            </div>
            </div>
        </div>
    );
};

export default LoginForm;
